import './App.css';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import Particle from './components/Particles/Particles';
import { Component } from 'react';
import Clarifai from 'clarifai';
import FaceRecognition from './components/FaceRecognition/FaceRecognition';

const app = new Clarifai.App({
    apiKey: "94fcec7fc44d4da5b7c0450d8d1bb734",
});  

class App extends Component {
	constructor() {
		super();
		this.state = {
			input: '',
			imageURL: '',
		}
	}

	onInputChange = (event) => {
		console.log(event.target.value);
	}

	onButtonSubmit = () => {
		this.setState({imageURL: input})
		// app.models.predict("94fcec7fc44d4da5b7c0450d8d1bb734", "https://i.insider.com/5d321d4ea209d3146d650b4a?width=1100&format=jpeg&auto=webp").then(
		// function(response) {
		// 	console.log(response)
		// },
		// function (err) {

		// }
		// )
		app.models.predict(
		  Clarifai.COLOR_MODEL,
		  "https://samples.clarifai.com/face-det.jpg"
		  )
		  .then((response) => {
		   console.log(response);
		  })
		  .catch((err) => {
		   console.log(err);
		  });
	}

	render() {
		return (
		<div className="App">
			<Particle className='particle-settings'/>
			<Navigation />
			<Logo />
			<Rank />
			<ImageLinkForm onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}/>

			<FaceRecognition imageURL={this.state.imageURL}/>
		</div>
		);
	}
}

export default App;
